        return new Source("<!DOCTYPE html>
<html>
    <head>
        <meta charset=\"UTF-8\">
        <title>{% block title %}Welcome!{% endblock %}</title>
        <link rel=\"stylesheet\" href=\"https://bootswatch.com/4/flatly/bootstrap.min.css\">
        <link rel=\"stylesheet\" href=\"{{ asset('assets/css/monStyle.css') }}\">
        {% block stylesheets %}{% endblock %}
    </head>
    <body>
        <nav class=\"navbar navbar-expand-lg navbar-light bg-light\">
            <a class=\"navbar-brand\" href=\"{{ path('home') }}\">Mes Poissons</a>
            <button class=\"navbar-toggler\" type=\"button\" data-toggle=\"collapse\" data-target=\"#navbarColor03\" aria-controls=\"navbarColor03\" aria-expanded=\"false\" aria-label=\"Toggle navigation\">
                <span class=\"navbar-toggler-icon\"></span>
            </button>

            <div class=\"collapse navbar-collapse\" id=\"navbarColor03\">
            <ul class=\"navbar-nav mr-auto\">
              <li class=\"nav-item\">
                  <a class=\"nav-link\" href=\"{{ path('mes_poissons', {'offset' : 0} )}}\">Espèces <span class=\"sr-only\">(current)</span></a>
              </li>
                <li class=\"nav-item\">
                  <a class=\"nav-link\" href=\"{{ path('site')}}\">Sites</a>
                </li>
                <!-- Gestion de l'espace ADMIN -->
                {% if app.user and \"ROLE_ADMIN\" in app.user.roles %}
                <li class=\"nav-item\">
                  <a href=\"{{ path('category_create') }}\" class=\"nav-link\">Nouvelle catégorie</a>
                </li>
                {% endif %}
              </ul>
              <ul class=\"navbar-nav\">
                {% if not app.user %}
                <li class=\"nav-item\">
                  <a class=\"nav-link\" href=\"{{ path('security_login')}}\">login</a>
                </li>
                {% else %}
                <li class=\"nav-item\">
                    <a class=\"nav-link\" href=\"{{ path('security_logout')}}\">
                      {{ app.user.username }} / logout
                    </a>
                </li>
                {% endif %}
              </ul>
            </div>
        </nav>
        <div class=\"container\">
            {% block body %}{% endblock %}
        </div>
        </script>
        {% block javascripts %}{% endblock %}
    </body>

    </script>
</html>
